int majorityElement(int *nums, int numsSize){

  int count = 0;
  int result = nums[0];

  for(int i = 0; i < numsSize;i ++){
    if(count == 0 ){
      count++;
      result = nums[i];
    }
    else if(result != nums[i])
      count--;
    else
      count++;
  }

  return result;

  return 0;
}
